import React from 'react'
import PropTypes from 'prop-types';


const Header = ({title}) => {
    // const onClick = () => {
    //     console.log('click')
    // }
    return (
        <header className='header'>
            <h1>{title}</h1>

            <a>About</a>
            <a>Portfolio</a>
            <a>Resume</a>
            <a>Contact</a>
        </header>
    )
}

Header.defaultProps = {
    title: 'Daniel Bradley',
}

Header.propTypes = {
    title: PropTypes.string.isRequired,
}

export default Header
